selector_to_html = {"a[href=\"sections/For_Shareholders.html#seo-analysis-and-recommendations\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">SEO Analysis and Recommendations<a class=\"headerlink\" href=\"#seo-analysis-and-recommendations\" title=\"Link to this heading\">#</a></h2>", "a[href=\"sections/Vote_Your_Proxy_Online.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Proxy Voting<a class=\"headerlink\" href=\"#proxy-voting\" title=\"Link to this heading\">#</a></h1><p>Proxy Voting\nSafe and Secure Stock and Shareholder Management Solutions</p><p>Here, you can easily vote using any proxy cards received via mail or email.</p>", "a[href=\"sections/online_account.html#headings-structure\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Headings Structure<a class=\"headerlink\" href=\"#headings-structure\" title=\"Link to this heading\">#</a></h2><p>The structure and hierarchy appear acceptable, ensuring ease of understanding for both users and search engines. However, creating a more descriptive heading for sections related to account setup could enhance clarity.</p>", "a[href=\"sections/online_account.html#seo-analysis-and-feedback-for-shareholder-signup-page\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">SEO Analysis and Feedback for Shareholder Signup Page<a class=\"headerlink\" href=\"#seo-analysis-and-feedback-for-shareholder-signup-page\" title=\"Link to this heading\">#</a></h1><h2>Title Tags &amp; Meta Descriptions<a class=\"headerlink\" href=\"#title-tags-meta-descriptions\" title=\"Link to this heading\">#</a></h2><p>Ensure the signup page has a unique Title Tag and Meta Description. Use keywords like \u201cShareholder Account Signup,\u201d \u201cStock and Share Management Online,\u201d and \u201cRegister for Shareholder Services.\u201d</p>", "a[href=\"sections/online_account.html#title-tags-meta-descriptions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Title Tags &amp; Meta Descriptions<a class=\"headerlink\" href=\"#title-tags-meta-descriptions\" title=\"Link to this heading\">#</a></h2><p>Ensure the signup page has a unique Title Tag and Meta Description. Use keywords like \u201cShareholder Account Signup,\u201d \u201cStock and Share Management Online,\u201d and \u201cRegister for Shareholder Services.\u201d</p>", "a[href=\"sections/Vote_Your_Proxy_Online.html#summary-and-additional-recommendations\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Summary and Additional Recommendations:<a class=\"headerlink\" href=\"#summary-and-additional-recommendations\" title=\"Link to this heading\">#</a></h2><p>By optimizing the \u201cProxy Voting\u201d section with detailed title tags, meta descriptions, structured content, and keyword integration, Transfer Online\u2122 can significantly improve its search engine visibility. Additionally, emphasizing security and ease of use in the content can build trust with users. Reviewing the mobile optimization status and readability on various devices is crucial to cater to the diverse needs of shareholders. Finally, considering the addition of a short video tutorial on how to vote might further increase user engagement and understanding of the process.</p>", "a[href=\"sections/online_account.html#mobile-optimization\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mobile Optimization<a class=\"headerlink\" href=\"#mobile-optimization\" title=\"Link to this heading\">#</a></h2><p>Confirm the page is fully responsive and performs efficiently on mobile devices. A smooth mobile experience can significantly influence user retention and search rankings.</p>", "a[href=\"sections/online_account.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Get An Online Account<a class=\"headerlink\" href=\"#get-an-online-account\" title=\"Link to this heading\">#</a></h1><p>Shareholder Signup</p>", "a[href=\"sections/online_account.html#account-information\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Account Information<a class=\"headerlink\" href=\"#account-information\" title=\"Link to this heading\">#</a></h1>", "a[href=\"sections/online_account.html#recommendations-for-further-improvements\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Recommendations for Further Improvements<a class=\"headerlink\" href=\"#recommendations-for-further-improvements\" title=\"Link to this heading\">#</a></h1>", "a[href=\"sections/online_account.html#internal-and-external-linking\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Internal and External Linking<a class=\"headerlink\" href=\"#internal-and-external-linking\" title=\"Link to this heading\">#</a></h2><p>Including internal links to related content like FAQs about the signup process, benefits of having an online account for shareholders, or a guide on how to vote your proxy online can improve user engagement and SEO. Adding external links to reputable financial governance bodies could enhance credibility.</p>", "a[href=\"sections/online_account.html#keyword-optimization\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Keyword Optimization<a class=\"headerlink\" href=\"#keyword-optimization\" title=\"Link to this heading\">#</a></h2><p>The page could benefit significantly from more keyword integration related to the financial services provided. Terms like \u201conline stock management,\u201d \u201cvote proxy online,\u201d and \u201csecure shareholder account setup\u201d may attract a more targeted audience.</p>", "a[href=\"sections/Certificate_Status.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Certificate Status for Shareholders<a class=\"headerlink\" href=\"#certificate-status-for-shareholders\" title=\"Link to this heading\">#</a></h1><p><strong>Certificate Status for Shareholders</strong></p>", "a[href=\"sections/For_Shareholders.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Shareholders Services<a class=\"headerlink\" href=\"#shareholders-services\" title=\"Link to this heading\">#</a></h1><p>Excellent customer service for every transaction, every time.</p><p>Join Transfer Online\u2122 today to simplify and empower your personal equity management.</p>", "a[href=\"sections/Vote_Your_Proxy_Online.html#seo-analysis-and-recommendations\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">SEO Analysis and Recommendations:<a class=\"headerlink\" href=\"#seo-analysis-and-recommendations\" title=\"Link to this heading\">#</a></h2><p>The <strong>Proxy Voting</strong> section of the Transfer Online\u2122 website provides users with a functionality to vote using proxy cards received via mail or email. Let\u2019s analyze and offer recommendations following the provided style guide.</p>", "a[href=\"sections/For_Shareholders.html#recommendations-for-further-improvements\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Recommendations for Further Improvements:<a class=\"headerlink\" href=\"#recommendations-for-further-improvements\" title=\"Link to this heading\">#</a></h2><p>By implementing these SEO and content enhancements, Transfer Online\u2122 can significantly improve its search engine visibility, engage better with its audience, and deliver a superior user experience.</p>", "a[href=\"#shareholder-services\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Shareholder Services<a class=\"headerlink\" href=\"#shareholder-services\" title=\"Link to this heading\">#</a></h1><p>This section contains proofread sections for the Shareholder section of TOL.</p>", "a[href=\"sections/online_account.html#alt-tags-for-images\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Alt Tags for Images<a class=\"headerlink\" href=\"#alt-tags-for-images\" title=\"Link to this heading\">#</a></h2><p>Ensure that any images used on the page have descriptive alt tags that incorporate relevant keywords. This can improve accessibility and contribute to image SEO.</p>", "a[href=\"sections/Vote_Your_Proxy_Online.html#grammar-and-style-proofreading-recommendations\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Grammar and Style Proofreading Recommendations:<a class=\"headerlink\" href=\"#grammar-and-style-proofreading-recommendations\" title=\"Link to this heading\">#</a></h2>", "a[href=\"sections/online_account.html#grammar-and-style\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Grammar and Style<a class=\"headerlink\" href=\"#grammar-and-style\" title=\"Link to this heading\">#</a></h2><p>The proofread content now adheres more closely to standard grammar and style guidelines, improving readability and consistency across the page. Transitioning to an active voice in specific sections might further engage the readers.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false, theme: 'material', duration: [200, 100], delay: [200, 500],

            });
        };
    };
    console.log("tippy tips loaded!");
};
